import React, { useEffect } from 'react';

const SchoolLocation = () => {
    useEffect(() => {
        // Check if the 'H' object is available in the global scope
        if (window.H) {
            const platform = new window.H.service.Platform({
                apikey: 'q4gwOr4LRf76boaHs_TrqPnsu5ZIAg1_9qx0vQbftrA', // Replace this with your actual API key
            });

            const defaultLayers = platform.createDefaultLayers();
            const map = new window.H.Map(
                document.getElementById('mapContainer'),
                defaultLayers.vector.normal.map,
                {
                    center: { lat: 22.708389, lng: 90.359921 },
                    zoom: 15,
                }
            );

            // Enable map events (panning, zooming, etc.)
            new window.H.mapevents.Behavior(new window.H.mapevents.MapEvents(map));

            // Optional: Add UI components to the map
            const ui = window.H.ui.UI.createDefault(map, defaultLayers);
        }
    }, []);

    return <div id="mapContainer" style={{ height: '400px', width: '100%' }} />;
};

export default SchoolLocation;
